import './App.css';
import Navbar from './components/navbar';
import HomeMain from './components/home/homeMain';
import { Route, Routes } from 'react-router-dom';
import Footer from './components/footer';
function App() {
  return (
    <div className="App">
        <Navbar />
        <Routes>
            <Route path='/' element={<HomeMain />} />
        </Routes>

    </div>
  );
}

export default App;
